job_summary:
Contexte 
Nous recherchons un Développeur PHP/ Drupal (H/F). 

 Projet 
Intégré(e) au sein d’une équipe projet, vous contribuez à la construction et l’évolution de la partie back end des différentes applications que nous réalisons. 

 Poste et missions 


Dans le cadre de vos missions, vous :


Concevez et réalisez les développements sous PHP 7/ 8 , Drupal7
Participez à l’évolution de l’architecture hexagonale ou microservices;
Ecrivez les tests automatisés unitaires (PHPUnit) et de non-régression ;
Assurez la rédaction de documentations techniques ;
Participez à la résolution des problématiques de performances et de montées en charge ;
Travaillez en méthodologie Agile.

Environnement Technique : PHP 7/8, Drupal 8/9, architecture hexagonale, API Platform, MySQL, Git, CI/CD. 

 Profil 
De formation Bac +2 à Bac +5, 


Vous avez une très bonne maitrise de PHP7 ;
Vous maitrisez Drupal 7/8;
Vous avez travaillé avec des problématiques de cache et de performance (utilisation de varnish, redis etc) ;
Vous avez une passion pour le développement et les challenges algorithmiques.

Dans un souci d’accessibilité et de clarté, l’écriture inclusive n’est pas utilisée dans cette annonce. Les termes employés au masculin se réfèrent aussi bien au genre féminin que masculin.

 Et si vous viviez l’expérience du changement ? Développer, imaginer, créer, digitaliser, accompagner, transformer : l’expérience du changement est stimulante et épanouissante. 
Nous vous proposons de venir la vivre avec nous, en rejoignant un univers où le design de solutions rencontre la technologie de pointe. Faites bouger les lignes en gagnant en agilité et en créativité et en prenant place dans un large réseau d’experts international... Construisez une carrière agile dans un environnement de travail flexible. Rejoignez Accenture certifiée Great Place To Work, et venez imaginer, transformer et impacter positivement le monde. Be a change maker.

 En tant que Développeur, quelles seront vos missions ?
 Le développeur contribue au développement, à la mise en place et à la gestion de solutions technologiques pour les entreprises. Il a une certaine expérience du coding, du test et de la mise en œuvre des changements de configuration :

 Coder et tester les modules de programme conformes aux spécifications de conception;
 Participer à l'analyse des exigences techniques relatives aux applications;
 Contribuer à la mise en œuvre de l'infrastructure technique: réseaux, plates-formes, serveurs, data...;
 Assurer la maintenance et l'évolution des logiciels afin qu'ils continuent à fournir des performances conformes aux spécifications;
 Apporter un support aux utilisateurs;
 Rédiger les tests nécessaires pour s'assurer que l'environnement technique répond aux exigences de performance;
 Exécuter les plans de conversion et identifier les failles de process.




Le métier de Développeur est fait pour vous si :

 Vous êtes issu d’une formation supérieure Bac +5 en informatique;
 Vous maîtrisez l’anglais à l’écrit comme à l’oral;
 Vous êtes mobile en France et à l’étranger;
 Vous avez une première expérience réussie sur des technologies Custom Dev telles que Java, J2EE, Python, AngularJS, PL/SQL, C++, Git/Jenkins…;
 Vous avez des appétences pour l’Agilité : Scrum, Xtrem Programming;
 Vous faites preuve d’un esprit collaboratif;
 Vous êtes reconnu pour vos capacités d’écoute.


 Le poste est à pourvoir en CDI sur Paris et/ou Toulouse.

 En tant que Développeur, vous rejoignez nos experts Technology pour exploiter la puissance du digital, stimuler l’innovation et améliorer le quotidien de nos clients. Conjuguez expertise business et connaissance des technologies de pointe pour aider nos clients à réinventer leur entreprise, tout en renforçant leur cyber-résilience.

 Accenture, c'est une communauté de plus de 600 000 talents et une mission commune réaliser la promesse technologique alliée à l’ingéniosité humaine.

 Dans un monde en perpétuel changement, nous accélérons la transformation des plus grandes entreprises, de la stratégie à la réalisation des projets, à l’aide des technologies de demain et dynamisons leur croissance grâce à l'expertise multi-sectorielle de nos experts !
 Vivez l’expérience du changement en rejoignant notre équipe, une équipe qui aspire à créer de la valeur pour ses clients et à faire toujours mieux pour ses talents.
 Envie d’en savoir plus sur le quotidien des collaborateurs Accenture ? Posez-leur directement vos questions.
 Vivez l’expérience du changement ? Postulez dès maintenant.

L’entité Capgemini Engineering rassemble des passionnés qui travaillent ensemble afin de proposer des produits à la pointe des nouvelles technologies dans les domaines industriels (aéronautique, énergie, ferroviaire, pharmaceutique...).




 Description de la mission


 En intégrant les équipes de Guillaume, vous interviendrez dans un de nos projets au forfait pour participer à la maintenance et au développement de nouvelles fonctionnalités d’une dizaine d’applications métier. 
Au sein d’une équipe d’une dizaine de développeurs travaillant en mode agile, vos principales missions seront de : 

Développer les nouvelles fonctionnalités ;
 Mettre en place de la phase de test et recette du fonctionnement des applications ;
 Participer aux phases de mise en production et livraison des nouvelles applications ;
 Vérifier l'intégration du développement ;
 Participer aux ateliers métiers en lien avec les business analystes, 
Assurer la maintenance et mise à jour de pages ou applications existantes et assurer le support au métier.





 Ce qui vous différencie :


 En formation supérieure (Ecole d’ingénieur, Master spécialisé), vous maîtrisez le langage C# ainsi que les frameworks .NET et/ou WPF. Vous êtes intéressé pour vous former à de nouvelles technologies (low code…) ou méthodologie de travail (agile SAFe…). Votre curiosité intellectuelle vous permet d’appréhender les problématiques métier complexes et de vous appréciez travailler en équipe.

 CAPGEMINI, entreprise handi accueillante, conformément à la norme AFNOR NF X50-783,est également signataire de la charte de la diversité en entreprise.
